import axios from 'axios';

export default class Apps extends React.Component {
  state = {
    movies: []
  }

  componentDidMount() {
    axios.get(`http://www.omdbapi.com/?apikey=faf7e5bb&s=Batman&page=2`)
      .then(res => {
        const movies = res.data;
        this.setState({ movies });
      })


  }



  render() {
    return (


      <ul>
        { this.state.movies.search.map(x => <li>{x.Title}</li>)}
      </ul>

    )
  }
}
